import React from 'react'
import { Link } from 'react-router-dom'

const CreatActivity = () => {
  return (
    <div>
        <h1> Create Activity </h1>
        <Link to='/home'>
            <button>Home</button>
        </Link>
    </div>
  )
}

export default CreatActivity
